import{_ as e,a}from"./chunks/pixhawk4_status_leds.BNrM6JGL.js";import{_ as r,c as d,a8 as o,o as i}from"./chunks/framework.BDnHobkS.js";const f=JSON.parse('{"title":"LED 신호 설명 (Pixhawk 시리즈)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/getting_started/led_meanings.md","filePath":"ko/getting_started/led_meanings.md"}'),s={name:"ko/getting_started/led_meanings.md"};function l(n,t,h,c,p,m){return i(),d("div",null,t[0]||(t[0]=[o('<h1 id="led-신호-설명-pixhawk-시리즈" tabindex="-1">LED 신호 설명 (Pixhawk 시리즈) <a class="header-anchor" href="#led-신호-설명-pixhawk-시리즈" aria-label="Permalink to &quot;LED 신호 설명 (Pixhawk 시리즈)&quot;">​</a></h1><p><a href="./../flight_controller/pixhawk_series.html">Pixhawk-series flight controllers</a> use LEDs to indicate the current status of the vehicle.</p><ul><li>The <a href="#ui_led">UI LED</a> provides user-facing status information related to <em>readiness for flight</em>.</li><li>The <a href="#status_led">Status LEDs</a> provide status for the PX4IO and FMU SoC. 전원, 부트 로더 모드, 활동 및 오류에 관련된 정보를 표시합니다.</li></ul><p><a id="ui_led"></a></p><h2 id="ui-led" tabindex="-1">UI LED <a class="header-anchor" href="#ui-led" aria-label="Permalink to &quot;UI LED&quot;">​</a></h2><p>The RGB <em>UI LED</em> indicates the current <em>readiness for flight</em> status of the vehicle. This is typically a superbright I2C peripheral, which may or may not be mounted on the flight controller board (i.e. FMUv4 does not have one on board, and typically uses an LED mounted on the GPS).</p><p>아래 이미지는 LED와 차량 상태의 관계를 나타냅니다.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>It is possible to have a GPS lock (Green LED) and still not be able to arm the vehicle because PX4 has not yet <a href="./../flying/pre_flight_checks.html">passed preflight checks</a>. <strong>A valid global position estimate is required to takeoff!</strong></p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>In the event of an error (blinking red), or if the vehicle can&#39;t achieve GPS lock (change from blue to green), check for more detailed status information in <em>QGroundControl</em> including calibration status, and errors messages reported by the <a href="./../flying/pre_flight_checks.html">Preflight Checks (Internal)</a>. 또한 GPS 모듈이 연결 여부, Pixhawk와 GPS 연동 여부, 정확한 GPS 위치를 전송 여부를 확인하십시오.</p></div><p><img src="'+e+'" alt="LED meanings"></p><ul><li><p><strong>[Solid Blue] Armed, No GPS Lock:</strong> Indicates vehicle has been armed and has no position lock from a GPS unit. 기체에 시동을 걸면, PX4는 모터를 제어하여 드론을 조종합니다. 고속 회전하는 프로펠러는 항상 위험하므로, 시동시에 조심하여야 합니다. 이 모드에서는 차량이 안내 임무를 수행 할 수 없습니다.</p></li><li><p><strong>[Pulsing Blue] Disarmed, No GPS Lock:</strong> Similar to above, but your vehicle is disarmed. 모터를 제어할 수 없지만, 다른 하위 시스템들은 작동한다는 것을 의미합니다.</p></li><li><p><strong>[Solid Green] Armed, GPS Lock:</strong> Indicates vehicle has been armed and has a valid position lock from a GPS unit. 기체에 시동을 걸면, PX4는 모터를 제어하여 드론을 조종합니다. 고속 회전하는 프로펠러는 항상 위험하므로, 시동시에 조심하여야 합니다. 이 모드에서 기체는 안내 임무를 수행할 수 있습니다.</p></li><li><p><strong>[Pulsing Green] Disarmed, GPS Lock:</strong> Similar to above, but your vehicle is disarmed. 모터는 제어할 수 없지만, GPS 위치 잠금을 포함한 다른 하위 시스템들은 작동합니다.</p></li><li><p><strong>[Solid Purple] Failsafe Mode:</strong> This mode will activate whenever vehicle encounters an issue during flight, such as losing manual control, a critically low battery, or an internal error. 사고 방지 모드에서는 기체는 이륙 위치로 복귀하거나, 현재 위치에 착륙할 수 있습니다.</p></li><li><p><strong>[Solid Amber] Low Battery Warning:</strong> Indicates your vehicle&#39;s battery is running dangerously low. 특정 시점이 지나면, 차량은 안전 방지 모드로 전환됩니다. 그러나, 이 모드는 종료시점에는 경고 메시지를 표시합니다.</p></li><li><p><strong>[Blinking Red] Error / Setup Required:</strong> Indicates that your autopilot needs to be configured or calibrated before flying. 자동조종장치를 지상관제국에 연결하여 무슨 문제인지를 확인하십시오. 설정 프로세스를 완료후에도, 자동조종장치가 여전히 빨간색으로 깜박이면 다른 오류가 있음을 나타냅니다.</p></li></ul><p><a id="status_led"></a></p><h2 id="led-상태" tabindex="-1">LED 상태 <a class="header-anchor" href="#led-상태" aria-label="Permalink to &quot;LED 상태&quot;">​</a></h2><p>Three <em>Status LEDs</em> provide status for the FMU SoC, and three more provide status for the PX4IO (if present). 전원, 부트 로더 모드, 활동 및 오류에 관련된 정보를 표시합니다.</p><p><img src="'+a+'" alt="Pixhawk 4"></p><p>전원이 켜지면 FMU와 PX4IO CPU는 먼저 부트로더를 실행후 응용 프로그램을 실행합니다. 아래 표는 부트로더와 앱의 LED를 상태를 표시 방법을 설명합니다.</p><table tabindex="0"><thead><tr><th>색상</th><th>라벨</th><th>부트로더 사용법</th><th>앱 사용법</th></tr></thead><tbody><tr><td>청색</td><td>활동</td><td>부트로더가 데이터를 수신시 깜빡임</td><td>시동 상태 표시</td></tr><tr><td>적색/황색</td><td>부트로더 에러</td><td>부트로더에서 깜빡임</td><td>에러 표시</td></tr><tr><td>녹색</td><td>파워</td><td>부트로더에서 사용되지 않음</td><td>시동 상태 표시</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The LED labels shown above are commonly used, but might differ on some boards.</p></div><p>LED가 의미하는 메시지에 관한 자세한 정보는 아래에서 설명합니다( &quot;x&quot;는 &quot;모든 상태&quot;를 의미).</p><table tabindex="0"><thead><tr><th>적색/황색</th><th>청색</th><th>녹색</th><th>설명</th></tr></thead><tbody><tr><td>10Hz</td><td>x</td><td>x</td><td>Overload CPU load &gt; 80%, or RAM usage &gt; 98%</td></tr><tr><td>OFF</td><td>x</td><td>x</td><td>Overload CPU load &lt;= 80%, or RAM usage &lt;= 98%</td></tr><tr><td>NA</td><td>OFF</td><td>4 Hz</td><td>actuator_armed-&gt;armed &amp;&amp; failsafe</td></tr><tr><td>NA</td><td>ON</td><td>4 Hz</td><td>actuator_armed-&gt;armed &amp;&amp; !failsafe</td></tr><tr><td>NA</td><td>OFF</td><td>1 Hz</td><td>!actuator_armed-&gt; armed &amp;&amp; actuator_armed-&gt;ready_to_arm</td></tr><tr><td>NA</td><td>OFF</td><td>10 Hz</td><td>!actuator_armed-&gt;armed &amp;&amp; !actuator_armed-&gt;ready_to_arm</td></tr></tbody></table>',20)]))}const b=r(s,[["render",l]]);export{f as __pageData,b as default};
